void capture(OV *camV3, LCD_MENU *myLCD)
{
    camV3->turn(on);
    LE.on(1);
    u0_dbg_printf("Starting to capture\n\n");
    camV3->captureImg(640, 480, myLCD);
    u0_dbg_printf("Capture Done\n\n");
    camV3->turn(off);
    LE.off(1);
}
void lcd_tsk(void*p)
{
    LabGPIO_X CS(0, 1), RST(0, 0);

    LCD_MENU *CurrentMenuG = nullptr;
    u0_dbg_printf("STARTED\n");
    OV *camV3 = new OV();

    /*
     //8MHz PWM clock, P2.0

     D[0].setPinPort(0, 29);
     D[1].setPinPort(0, 30);
     D[2].setPinPort(1, 19);
     D[3].setPinPort(1, 20);
     D[4].setPinPort(1, 22);
     D[5].setPinPort(1, 23);
     D[6].setPinPort(1, 28);
     D[7].setPinPort(1, 29);

     RESET.setPinPort(2, 1);
     PWDN.setPinPort(2, 2);

     VSync.setPinPort(2, 3);
     Href.setPinPort(2, 4);
     Pclk.setPinPort(2, 5);
     */

    camV3->camInit();
    u0_dbg_printf("INIT_DONE\n");
//    camV3->setRes(qvga_ov7670);
//    camV3->setColor(regsRGB565);
//    u0_dbg_printf("SET_COLOR_DONE\n");
//    camV3->setColor(OV7670_QVGA);
//    camV3->wrReg(0x11, 20); //Earlier it had the value: wrReg(0x11, 12); New version works better for me :) !!!!
    camV3->turn(off);
    u0_dbg_printf("CAM TUREND OFF\n");

    LCD_MENU *MAIN = new LCD_MENU(CS, RST, 30, "MAIN", CurrentMenuG, nullptr, menuType);

    //Make the MAIN MENU
    MAIN->addSubMenu("Sub1");
    MAIN->addSubMenu("Sub2");
    MAIN->addItem("It1");
    MAIN->addItem("It2");

    //Sub1
    LCD_MENU *Sub1 = MAIN->confirmedGetSubMenu("Sub1");
    Sub1->addSubMenu("Sub1_Sub1");
    Sub1->addSubMenu("Sub1_Sub2");
    Sub1->addItem("Sub1_It1");
    Sub1->addItem("Sub1_It2");

    //Sub1_Sub1
    LCD_MENU *Sub1_Sub1 = Sub1->confirmedGetSubMenu("Sub1_Sub1");
    Sub1_Sub1->addSubMenu("Sub1_Sub1_Sub1");
    Sub1_Sub1->addItem("Sub1_Sub1_It1");

    //Sub2
    LCD_MENU *Sub2 = MAIN->confirmedGetSubMenu("Sub2");
    Sub2->addSubMenu("Sub2_Sub1");
    Sub2->addSubMenu("Sub2_Sub2");
    Sub2->addItem("Sub2_It1");
    Sub2->addItem("Sub2_It2");

    bool pressed = true;
    CurrentMenuG = MAIN;

    //INIT LCD PART
    if (CurrentMenuG->lcd->begin(RA8875_800x480)) u0_dbg_printf("DONE_INIT\n");
    else {
        u0_dbg_printf("INIT NOT DONE\n");
        while (1)
            ;
    }
    CurrentMenuG->lcd->displayOn(true);
    CurrentMenuG->lcd->GPIOX(true);      // Enable TFT - display enable tied to GPIOX
    CurrentMenuG->lcd->PWM1config(true, RA8875_PWM_CLK_DIV1024); // PWM output for backlight
    CurrentMenuG->lcd->PWM1out(255);

    CurrentMenuG->lcd->graphicsMode();
    CurrentMenuG->lcd->fillScreen(RA8875_BLACK);
    vTaskDelay(500);

//    CurrentMenuG->clear_disp((uint16_t*) photo);
//    CurrentMenuG->drawArray((uint16_t *) photo, 100 * 100, 100, 400 - 100, 240 - 100);

//    for(uint16_t i=0;i<10000;i++){
//    uint8_t pix8[2] = {photo[i]&0xFF, photo[i]>>8};
//        Storage::append("1:sjsu.txt",pix8,2);
//    }
//    u0_dbg_printf("DONE\n");
//    for (int i = 0; i < 640; i += 100) {
//        for (int j = 0; j < 400; j += 100) {
//    CurrentMenuG->drawArray((uint16_t *) photo, 100 * 100, 100, 640 / 2 - 50, 400 / 2 - 50);
//        }
//    }
    for(int i=0;i<100;i++)
    {
        uint16_t *pixels = new uint16_t[100];
        Storage::read("1:sjsu.txt",pixels,2*100,i*2*100);
        CurrentMenuG->drawArray((uint16_t *) pixels, 100, 100, 640 / 2 - 50, 400 / 2 - 50 + i);
    }
    while (1) {
        //DOWN
        if (SW.getSwitch(2))
        {
            pressed = true;
            CurrentMenuG->scrollDown();
        }

        //UP
        if (SW.getSwitch(1))
        {
            pressed = true;
            CurrentMenuG->scrollUp();
        }

        //SELECT
        if (SW.getSwitch(3))
        {

            CurrentMenuG->lcd->graphicsMode();

//            for(int i=0;i<100;i++){
//             u0_dbg_printf("%d->\n",i);
//             camV3->wrReg(0x11, 1<<i);
//             capture(camV3,CurrentMenuG);
//             }

           // for(int i=50;i<100;i++) {
//                u0_dbg_printf("%d->\n",i);

                camV3->wrReg(0x11,46);
                capture(camV3,CurrentMenuG);
            //}
//            capture(camV3,CurrentMenuG);
            CurrentMenuG->lcd->textMode();
            vTaskDelay(10);
            pressed = true;
            CurrentMenuG = CurrentMenuG->loadNext();
        }

        //BACK
        if (SW.getSwitch(4))
        {
            pressed = true;
            CurrentMenuG = CurrentMenuG->loadPrev();
        }
        //BUTTON PRESS
        if (pressed) {
            CurrentMenuG->Display();

            pressed = false;
        }
        vTaskDelay(250);
    }
}

#define scheduler 1

int main()
{

// PWM PW(PWM::pwm1, 8000000);
//        PW.set(50);

#if scheduler
    scheduler_add_task(new terminalTask(PRIORITY_MEDIUM));
    xTaskCreate(lcd_tsk, "LCD", 1024 * 4, (void*) 1, PRIORITY_MEDIUM, NULL);
    scheduler_start();
#else
    xTaskCreate(lcd_tsk, "LCD", 1024 * 4, (void*) 1, PRIORITY_MEDIUM, NULL);
    vTaskStartScheduler();
#endif

    return 0;
}
